                <h1>hi</h1>
                <div className="profile">
                    <img src={myimage} alt={myimage}/>
                    <h1>Bayu Dirgantara</h1>
                    <p>bayuusetiawan86@gmail.com</p>
                </div>
            </main>
            <style jsx global>{`
                main {
                    background: url(${jumbotron});
                    min-height: 455px;
                    display: flex;
                    justify-content: center;
